import React, { useEffect, useState } from 'react';
import './Home.css';

function Home() {
  const [slideIn, setSlideIn] = useState(false);

  useEffect(() => {
    setSlideIn(true);
  }, []);

  return (
    <div className="image-slider">
      <img
        src={logoImage}
        alt="Sliding Image"
        className={slideIn ? 'slide-in' : ''}
      />
    </div>
  );
}

export default Home;
